import React, { useState, useEffect } from "react";
import axios from "axios";

const WeatherHistory = () => {
    const [records, setRecords] = useState([]);
    const [searchTerm, setSearchTerm] = useState("");
    const [searchType, setSearchType] = useState("recent"); // 默认搜索最近 10 条数据
    const [loading, setLoading] = useState(false);

    useEffect(() => {
        fetchWeatherHistory(); // 组件加载时获取最近 10 条数据
    }, []);

    const fetchWeatherHistory = async () => {
        setLoading(true);
        try {
            let url = "http://localhost:5000/api/weather/history";

            if (searchType !== "recent" && searchTerm.trim() !== "") {
                url = `http://localhost:5000/api/weather/history?${searchType}=${searchTerm}`;
            }

            console.log(`🔍 Fetching weather history: ${url}`);
            const response = await axios.get(url);

            setRecords(response.data);
            console.log("✅ Weather history data:", response.data);
        } catch (error) {
            console.error("❌ Error fetching weather history:", error.message);
            alert("Failed to fetch weather history.");
        }
        setLoading(false);
    };

    return (
        <div>
            <h2>Weather History</h2>

            {/* 🔍 搜索框 */}
            <div>
                <select value={searchType} onChange={(e) => setSearchType(e.target.value)}>
                    <option value="recent">Recent 10</option>
                    <option value="user">By Username</option>
                    <option value="date">By Date</option>
                    <option value="location">By Location</option>
                </select>
                <input
                    type="text"
                    value={searchTerm}
                    onChange={(e) => setSearchTerm(e.target.value)}
                    placeholder="Enter search term"
                    disabled={searchType === "recent"}
                />
                <button onClick={fetchWeatherHistory}>Search</button>
            </div>

            {loading ? (
                <p>Loading weather history...</p>
            ) : (
                <table border="1">
                    <thead>
                        <tr>
                            <th>Queried At</th>
                            <th>Location</th>
                            <th>Weather</th>
                            <th>Temperature (°C)</th>
                            <th>Wind Speed (km/h)</th>
                            <th>Humidity (%)</th>
                        </tr>
                    </thead>
                    <tbody>
                        {records.length > 0 ? (
                            records.map((record, index) => (
                                <React.Fragment key={index}>
                                    {/* 当前天气 */}
                                    <tr>
                                        <td>{new Date(record.queriedAt).toLocaleString()}</td>
                                        <td>{record.location || "Unknown"}</td>
                                        <td>{record.current_weather?.weather || "N/A"}</td>
                                        <td>{record.current_weather?.temperature || "N/A"}</td>
                                        <td>{record.current_weather?.wind_speed || "N/A"}</td>
                                        <td>{record.current_weather?.humidity || "N/A"}</td>
                                    </tr>

                                    {/* 过去 3 天的天气 */}
                                    {record.past_weather?.map((day, i) => (
                                        <tr key={`${index}-past-${i}`}>
                                            <td>{day.date} (Past)</td>
                                            <td>{record.location || "Unknown"}</td>
                                            <td>{day.weather_code ? `Code: ${day.weather_code}` : "N/A"}</td>
                                            <td>{day.temperature_max || "N/A"} / {day.temperature_min || "N/A"}</td>
                                            <td>N/A</td>
                                            <td>N/A</td>
                                        </tr>
                                    ))}

                                    {/* 未来 2 天的天气 */}
                                    {record.future_weather?.map((day, i) => (
                                        <tr key={`${index}-future-${i}`}>
                                            <td>{day.date} (Future)</td>
                                            <td>{record.location || "Unknown"}</td>
                                            <td>{day.weather || "N/A"}</td>
                                            <td>{day.temperature || "N/A"}</td>
                                            <td>{day.wind_speed || "N/A"}</td>
                                            <td>{day.humidity || "N/A"}</td>
                                        </tr>
                                    ))}
                                </React.Fragment>
                            ))
                        ) : (
                            <tr>
                                <td colSpan="6">No records found.</td>
                            </tr>
                        )}
                    </tbody>
                </table>
            )}
        </div>
    );
};

export default WeatherHistory;
